import sys
sys.dont_write_bytecode = True

import os
import base64
import shutil
import subprocess

def get_description():
    return "This module automatically signs all compiled binaries in \"Exe\" format"

def main(app, caller, payload, format):
    if caller == "generate" and "Exe" in format:
        signature = ""
        signature_path = "custom/SigThief/signature.exe"
        os.makedirs(os.path.dirname(signature_path), exist_ok=True)
        
        with open(signature_path, "wb") as sig_file:
            sig_file.write(base64.b64decode(signature))
        
        payload_signed = str(payload) + "_signed.exe"
        payload = str(payload) + ".exe"
        subprocess.run([sys.executable, "custom/SigThief/sigthief.py", "-i", signature_path, "-t", payload, "-o", payload_signed], check=True, stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)

        try:
            if os.path.isfile(signature_path):
                os.remove(signature_path)
        except:
                pass
